INSERT INTO `v1_ee8eae8b9e464abeea43e7df98953bd8ab02795a0d445045f901c8341fa7819b` VALUES ("逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 1, "---", 1, "アサヒ", 6000, 2, 0, 3, "");
INSERT INTO `v1_ee8eae8b9e464abeea43e7df98953bd8ab02795a0d445045f901c8341fa7819b` VALUES ("無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 1, "アドレナリン", 3, "部員3", 16000, 3, 3, 0, "ホームランを連発すると、連発数に応じてパワーアップする");
INSERT INTO `v1_ee8eae8b9e464abeea43e7df98953bd8ab02795a0d445045f901c8341fa7819b` VALUES ("みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 1, "ラッキー", 2, "{0}", 30000, 4, 2, 2, "幸運のハプニングを呼び込む");
